import React, { useEffect, useState } from "react";
import { getPosts } from "./requests/requests";

function App() {
  const [posts, setPosts] = useState(null);

  useEffect(() => {
    getPosts.then(res => setPosts(res.data)).catch(err => console.log(err));
  }, [])

  return (
    <div>
      <h1>{posts}</h1>
    </div>
  );
}

export default App;
